import React, { Component } from "react";

class MenList extends Component {
  render() {
    const { subcategory, index } = this.props;
    return (
      <li className="nrMenItem">
        <a className={index === 0 ? "nrMenLinkMain" : "nrMenLink"} href>
          {subcategory}
        </a>
      </li>
    );
  }
}

export default MenList;
